import { useEffect } from 'react';
import {
  Routes,
  BrowserRouter as Router,
  Route,
  useParams
} from 'react-router-dom';

import { Home } from './pages/Home';

import { useAppDispatch } from './hooks/storeHooks';
import { setPostPageCount } from './store/postPageCount';

function App() {
  const dispatch = useAppDispatch();
  const postPageCount = useParams().postPageCount;

  useEffect(() => {
    if (!postPageCount) {
      window.location.href += '1';
      dispatch(setPostPageCount(1));
    }
  }, [postPageCount]);

  return (
    <Router>
      <Routes>
        <Route path="/:postPageCount" element={<Home />}></Route>
      </Routes>
    </ Router>
  );
}

export default App;
